import styled from "styled-components";

export const Container = styled.div`
  height: 89vh;
  width: 100vw;
  display: flex;
  background-color: #f5f5f5;

  .menu {
    height: 100%;
    width: 15%;
    background-color: #6a040f;
    border-top: 1px solid #ffffff;
  }
  .products {
    display: flex;
    flex-direction: row;
    flex-wrap: wrap;
    width: 80%;
    margin: 10px 0 0 10px;
  }
  .pageLeft {
    width: 50px;
    margin: auto auto;
  }
  .pageLeft button {
    border-radius: 100%;
  }
`;
